import { Route, Routes } from 'react-router-dom';
import './App.css';
import Home from './Pages/Home';
import TeamPage from './Components/TeamPage';
import NavBar from './Components/NavBar';

function App() {

  return (
    <div>
      <Routes>
        <Route path = '/' element = {<Home/>} />
        <Route path = '/team' element = {<TeamPage/>} />
      </Routes>
    </div>
  );
}

export default App;
